var video = $("#video").get()[0];
var canvasElement = $("#canvas").get()[0];
var canvas = canvasElement.getContext("2d");
var constraints = {};
var Lenses = [];
var current_using_index = 0;

$(document).ready(function() {
    navigator.mediaDevices.enumerateDevices()
    .then(gotDevices)
    .then(start)
    .catch(handleError);
    $("#swap_btn").click(function() {
        current_using_index = (current_using_index === Lenses.length - 1) ? 0 : current_using_index + 1;
        start();
    })
});

function gotDevices(deviceInfos) {
    for (var Ind in deviceInfos) {
        if (deviceInfos[Ind].kind === "videoinput") {
            Lenses.push(deviceInfos[Ind].deviceId);
        }
    }
}

function gotStream(stream) {
    window.stream = stream;
    video.srcObject = stream;
    return navigator.mediaDevices.enumerateDevices();
}

function handleError(error) {
    $("#loadingMessage").hide();
    console.log("Error: ", error);
    $("<div>", {
        "id": "err_box",
        "class": "alert alert-danger"
    }).text(error).insertBefore("#swap_btn");
}

function start() {
    if (window.stream) {
        window.stream.getTracks().forEach(track => {
            track.stop();
        });
    }
    constraints = {
        video: { deviceId: { exact: Lenses[current_using_index] } }
    }
    navigator.mediaDevices.getUserMedia(constraints)
    .then(gotStream)
    .then(function() {
        video.play();
        requestAnimationFrame(tick);
    }).catch(handleError);
}

function tick() {
    if (video.readyState === video.HAVE_ENOUGH_DATA) {
        $("#loadingMessage, #canvas").hide();
        canvasElement.width = video.videoWidth;
        canvasElement.height = video.videoHeight;
        canvas.drawImage(video, 0, 0, canvasElement.width, canvasElement.height);
        var imageData = canvas.getImageData(0, 0, canvasElement.width, canvasElement.height);
        var code = jsQR(imageData.data, imageData.width, imageData.height);
        if (code) {
            if (foundQR(code)) {
                return;
            }
        }
    }
    requestAnimationFrame(tick);
}

function heroBeep() {
    var snd = new Audio("data:audio/x-m4a;base64,");
    snd.play().catch(handleError);
}

function successBeep() {
    var snd = new Audio("data:audio/x-m4a;base64,");
    snd.play().catch(handleError);
}

function failureBeep() {
    var snd = new Audio("data:audio/x-m4a;base64,");
    snd.play().catch(handleError);
}

function foundQR(code) {
    drawLine(code.location.topLeftCorner, code.location.topRightCorner, "#FF3B58");
    drawLine(code.location.topRightCorner, code.location.bottomRightCorner, "#FF3B58");
    drawLine(code.location.bottomRightCorner, code.location.bottomLeftCorner, "#FF3B58");
    drawLine(code.location.bottomLeftCorner, code.location.topLeftCorner, "#FF3B58");
    if (code.data.startsWith("http://2018yzucamp.tyze.me/")) {
        heroBeep();
        $("#canvas").show();
        $("#video").hide();
        window.location = code.data;
        return true;
    } else {
        console.log("Scanned Unexpected datas: ");
        console.log(code.data);
        return false;
    }
}

function drawLine(begin, end, color) {
    canvas.beginPath();
    canvas.moveTo(begin.x, begin.y);
    canvas.lineTo(end.x, end.y);
    canvas.lineWidth = 4;
    canvas.strokeStyle = color;
    canvas.stroke();
}
